import "./cadastro.css";
import { createTheme, ThemeProvider } from "@mui/material/styles";
const theme = createTheme({
  status: {
    danger: "#e53e3e",
  },
  palette: {
    primary: {
      main: "#b9114b",
      darker: "#053e85",
    },
    neutral: {
      main: "#64748B",
      contrastText: "#fff",
    },
  },
});

function Cadastro() {
  return (
    <div className="principalCadastro">
      <h2 style={{ marginBottom: "70px" }}>PÃ¡gina de cadastro</h2>
      <span style={{ marginRight: "182px", marginBottom: "10px" }}>E-mail</span>
      <TextField
        label="Digite seu email"
        style={{ width: "271px" }}
      ></TextField>
      <span
        style={{
          marginRight: "162px",
