      >
        Password
      </span>
      <TextField
        label="Digite a senha"
        type="password"
        style={{ width: "271px" }}
      ></TextField>
      <span
        style={{
          marginRight: "162px",
          marginBottom: "10px",
          marginTop: "10px",
        }}
      >
        Password
      </span>

      <TextField
        label="Digite a senha novamente"
        type="password"
        style={{ width: "271px" }}
      ></TextField>
      <Button variant="contained" style={{ marginTop: "10px", width: "271px" }}>
        Cadastrar
      </Button>
    </div>
  );
}

export default Cadastro;
